  -- 3) Read the back-side redstone input
  if redstone.getInput("front") then           -- Get back-side input (boolean) :contentReference[oaicite:4]{index=4}
    rednet.broadcast("StatON", "SMiner")     -- Broadcast activation on protocol "pulse" :contentReference[oaicite:5]{index=5}
