    rednet.broadcast("StatOFF", "SMiner")   -- Broadcast deactivation on protocol "pulse" :contentReference[oaicite:6]{index=6}
  end
end

/**
 * Do a needle sweep
 */
void doNeedleSweep() {
  int maxKM = 300;
  int maxRPM = 8000;
  byte multiplier = maxRPM / maxKM + 4;

  byte step = 2;
  byte delayBetween = 250;
  byte delayDuring = 4;

  int km = 0;
  int rpm = 0;

  // Sweep from 0 to @var(maxKM) km/h
  // also sweep rpm from 0 to @var(maxRPM) rpm
  while (km < maxKM)
  {
    km += step;
    rpm = km * multiplier;

    setKmAndRpmWithDelay(km, rpm, delayDuring);
  }

  // Stay at max km/h for specified delay
  delay(delayBetween);

  // Sweep back to 0 km/h
  // also sweep rpm back to 0 rpm
  while (km > 0) {
    km -= step;
    rpm = km * multiplier;
    // slowing down the RPM needle a bit to match km/h needle
    if (km < 80){
      delay(20);
    }
    setKmAndRpmWithDelay(km - 30, rpm, delayDuring);
  }

